  false,\n\t\"url\": null,\n\t\"notes\": \"These data represent data collected from
  the Shipboard Environmental (data) Acquisition System (SEAS), a program developed
  by National Oceanic and Atmospheric Administration (NOAA) to provide accurate meteorological
  and oceanographic data in real time from ships at sea through the use of satellite
  data transmission techniques. The system transmits data through either the Geostationary
  Operational Environmental Satellite (GOES) or the International Maritime Satellite
  Organization (INMARSAT C) satellites to NOAA for use in weather, climatological
  and ocean models. NOAA is actively participating in an international effort to increase
  the number of subsurface temperature observations in support of global oceanographic
  and climate studies. NOAA's Expendable Bathythermograph (XBT) program, SEAS, currently
  supports about 80 Voluntary Observing Ships (VOS). SEAS XBT data are archived by
  the National Oceanographic Data Center (NODC) on a weekly basis.\",\n\t\"owner_org\":
